import './App.css';
import { createRoot } from 'react-dom/client';

const App = () => {
  return (
    <div className="App">

        <Title></Title>        

        <Content></Content>

        <Content></Content>

        <ApiCall></ApiCall>

    </div>
  );
}
export default App;
